									BodPoss.position = v.Position + Vector3.new(Mrandom(-15, 15), Mrandom(-15, 15), Mrandom(-15, 15))
									v.Color = maincolor.Color
									coroutine.resume(coroutine.create(function()
										for i = 0, 49 do
											swait(1)
