local _Arm = function(side,tf)
	local Arm = nil
	local Weld = nil
	local RWeld = nil
	for _,S in pairs(Sides) do
		if side:lower() == S:lower() then
			for _,A in pairs(Arms) do
				if A.Name:lower():find(side:lower()) then
					Arm = A
					Weld = Welds.ArmW[S]
					RWeld = RWelds.ArmW[S]
				end
			end
		end
	end
	if Arm and Weld and RWeld then
		if tf then
			Weld.Part1 = Arm
			RWeld.Part1 = nil
		elseif not tf then
			Weld.Part1 = nil
			RWeld.Part1 = Arm
		else
			print("Error")
		end
	end
end

