		elseif type == "Divide" then
		scaler2 = scaler2 - 0.01/value*bonuspeed/10
		end
		if rotenable == true then
		if randomrot == 1 then
		rng.CFrame = rng.CFrame*CFrame.Angles(0,math.rad(rotspeed*bonuspeed/2),0)
		elseif randomrot == 2 then
		rng.CFrame = rng.CFrame*CFrame.Angles(0,math.rad(-rotspeed*bonuspeed/2),0)
		end
